<script>
var rate = 8000 

var audio_context = undefined

var snd = undefined

function playSnd(buf){
  if(!audio_context) audio_context = new AudioContext();
  var source  = audio_context.createBuffer(1,buf.length,rate);
  source.copyToChannel(buf,0,0);
  var oup = audio_context.createBufferSource();
  oup.buffer = source;
  oup.connect(audio_context.destination);
  oup.start(0);
}

function makeSound(fr){
	if(fr==undefined) fr = 500
	let snd = new Float32Array(10000)
	let a =1
	let th =0
	let dth = Math.PI*2*fr/rate
	const dth0 = Math.PI*4*fr/rate
	for(let k=0;k<snd.length;k++){
		snd[k] = sat(0.1*th,0,1)*Math.sin(th)*a
		th += dth
		dth += 0.001*(dth0-dth)
		a *=0.993
	}
	return snd
}

function fullScreen(e){
    e = e||document.body;
	if(e.webkitRequestFullScreen)
		e.webkitRequestFullScreen();
	else if(e.mozRequestFullScreen)
		e.mozRequestFullScreen();
	else if(e.msRequestFullScreen)

//----------------------------------------------
// ** return a random number in [a,b[
//    if b is undefined: return a number in [-a,a[
//    if a and b are undefined: return a number in [-1,1[

function rnd(a,b){
	if(a==undefined){a=1;b=1}
	else if(b==undefined){b=-a}
	return a+(b-a)*Math.random();
}

function rndInt(a,b){
	return Math.floor(rnd(a,b))
}

function rndDecide(p){
	return (rnd(0,1)<=p)
}

function sat(v,a,b){
	if(v<=a)return a
	if(v>=b)return b
	return v
}

attribute vec4 color;

varying vec2 texc;

varying vec2 pos;

varying vec4 clr;

void main(){
   
   vec2 cf = vec2(1.0, 16.0/9.0);
   
   gl_Position =  vec4(a_Position*cf,0.0,1.0);
   
   clr  = color;

   texc = texco;
   
}
	
`

}

var ctx ,prog, vbuf, cbuf, tbuf;

	//--------------------------------
	// ** newBuffer: creates a buffer and bind it to attribute 'name'
    function newBuffer(name,size){
		var p = ctx.getAttribLocation(prog,name);
		var buffer = ctx.createBuffer(); 
		ctx.bindBuffer(ctx.ARRAY_BUFFER,buffer); 
		ctx.enableVertexAttribArray(p);
		ctx.vertexAttribPointer(p,size,ctx.FLOAT,false,0,0); 
		return buffer;
	} 	
	
	//---------------------------------
	// ** setBuffer: sets the vbalues in buffer 
    function setBuffer(buffer,values){

	}

function newTex(image){
 let tex = ctx.createTexture();
 ctx.bindTexture(ctx.TEXTURE_2D,tex);
 ctx.texParameteri(ctx.TEXTURE_2D, ctx.TEXTURE_WRAP_S, ctx.CLAMP_TO_EDGE);
 ctx.texParameteri(ctx.TEXTURE_2D, ctx.TEXTURE_WRAP_T, ctx.CLAMP_TO_EDGE);
 ctx.texParameteri(ctx.TEXTURE_2D, ctx.TEXTURE_MIN_FILTER, ctx.LINEAR);
 ctx.texParameteri(ctx.TEXTURE_2D, ctx.TEXTURE_MAG_FILTER, ctx.LINEAR);
 ctx.texImage2D(ctx.TEXTURE_2D,0,ctx.RGBA,image.width, image.height, 0, ctx.RGBA, ctx.UNSIGNED_BYTE,new Uint8Array(image.data)); 
 return tex;
}

var aspectRatio,World={},Camera={};

function initWorld(width,height){
	aspectRatio = can.height *1.0/ can.width
	World.width = width
	World.height = height
	World.hWidth = width/2
	World.hHeight = height/2
	Camera.x=0
	Camera.y=0
	Camera.maxX=World.hWidth-1
	Camera.maxY=World.hHeight-aspectRatio
}

function updateCamera(player){
	Camera.x = sat( player.x, -Camera.maxX,Camera.maxX)
	Camera.y = sat( player.y, -Camera.maxY,Camera.maxY)
}

function Sprite(x,y,w,h,tx){
	this.a  = tx[0]
	this.b  = tx[1]
	this.aa = tx[2]
	this.bb = tx[3]
	this.x  = x
	this.y  = y
	this.vx = 0
	this.vy = 0
	this.ax = 0
	this.ay = 0
	this.width = w
	this.height = h
	this.color = [rnd(0.6,1),rnd(0.6,1),rnd(0.6,1),1]
	this.th = rnd(Math.PI)
	
	this.detectWorldEdge=function(){
		const mx = World.hWidth-this.width/2
		const my = World.hHeight-this.height/2
		this.x = sat(this.x,-mx,mx)
		this.y = sat(this.y,-my,my)
	}
		
}

function addSpriteToBuf(sprite,buffer){
	let x = sprite.x - Camera.x
	let y = sprite.y - Camera.y
	let w = sprite.width *0.5
	let h = sprite.height*0.5
	let c = Math.cos(sprite.th )  
	let s = Math.sin(sprite.th )
	let px =  c*w-s*h
	let py =  s*w+c*h
	let qx = -c*w-s*h
	let qy = -s*w+c*h
	vArr=vArr.concat([
					x+px,y+py,
					x+qx,y+qy,
					x-px,y-py,
					x+px,y+py,
					x-px,y-py,
					x-qx,y-qy 
					])
	// tArr=tArr.concat([sprite.aa,sprite.bb,
					// sprite.a,sprite.bb,
					// sprite.a,sprite.b,
					// sprite.aa,sprite.bb,
					// sprite.a,sprite.b,
					// sprite.aa,sprite.b
					// ])
    tArr=tArr.concat([sprite.aa,sprite.b,
					sprite.a,sprite.b,
					sprite.a,sprite.bb,
					sprite.aa,sprite.b,
					sprite.a,sprite.bb,
					sprite.aa,sprite.bb
					])					
    for(let k=0;k<6;k++)					
	cArr=cArr.concat(sprite.color)
}

}

	//--------------------------------
	//----------------------------------------------
	// ** Globals
	var tm = 0.0;
	var animOn = false;
	var then = 0; 
	const quads = 97;
	const positions = new Float32Array(4*2*quads);
    const texpos    = new Float32Array(6*2*quads);
	const frq       = new Float32Array(4*2*quads);
    const  phase     = new Float32Array(4*2*quads);
	const clrs      = new Float32Array(4*4*quads);
	const sp=[]
	
	//-----------------------------------------------
	// ** Init Globals
	function initData(){
        
	 can.oncontextmenu=function(){return false}
     //------ coordinates on texture   
		 const texCoord = [0,0,0,1,0.5,1,0,0,0.5,1,0.5,0,
	                  0.5,0,0.5,1,1,1,0.5,0,1,1,1,0];
     for(let k=0;k<texpos.length;k++)
			texpos[k]=texCoord[k%texCoord.length]  
        
     //------ phases & freqs 
     for(let k=0;k<phase.length;k++)
			phase[k]=Math.PI * 2 * Math.random();
		
     for(let k=0;k<frq.length;k++)
			frq[k]=  1.85-2.5*Math.random();
		
		//------ colors
		for(let k=0;k<clrs.length;k++)
            if(k%4!=3)
			clrs[k]= Math.random();
            else clrs[k]=1;
		
		//------- create buffers & texture
		vbuf = newBuffer("a_Position",2);
		cbuf = newBuffer("color",4);
        tbuf = newBuffer("texco",2);		
		newTex(image);
		
		//--------create sprites
		const z=0.25;
		const txPos=[[0,0,0.25,0.5],[0.25,0,0.5,0.5],
		[0,0.5,0.25,1],[0.5,0,1,1],[0.25,0.5,0.5,1]]
		sp.push( new Sprite(rnd(Camera.maxX),rnd(Camera.maxY),
		                   0.45,0.35,
						   txPos[4]));
		for(let k=1;k<50;k++)
		if(rnd(0,1)<0.5)
			sp.push( new Sprite(rnd(Camera.maxX),rnd(Camera.maxY),
		                   rnd(0.13,0.49),rnd(0.13,0.49),
						   txPos[rndInt(0,3)] ));
		else
		sp.push( new Sprite(rnd(Camera.maxX),rnd(Camera.maxY),
		                   rnd(0.13,0.49),rnd(0.13,0.49),
						   txPos[rndInt(0,3)]));					
		//-- background	
		 
		 sp.push( new Sprite(0,0,

						   txPos[3]));					
		     
		 sp[sp.length-1].th=0
		 
		 sp[0].vx =0
		sp[0].vy =0
	}
	
	//------------------------------------------------
	function startAnimation(){
		requestAnimationFrame(drawScene);
	}
           
	function drawScene (time){
	  var dt = 0.001*(time-then)
		then=time;
		
		vArr=[]
		cArr=[]
		tArr=[]
		
		updateCamera(sp[0])
		addSpriteToBuf(sp[sp.length-1])
		 
		for(let k=sp.length-2;k>0;k--){
			let r =  0.1+0.01*k
			if(rndDecide(0.01)){
				sp[k].ax=rnd(1)
				sp[k].ay=rnd(1)
			}
			 
				sp[k].vx+=sp[k].ax*dt
				sp[k].vy+=sp[k].ay*dt
				sp[k].x+=sp[k].vx*dt
				sp[k].y+=sp[k].vy*dt
				sp[k].vx*=0.993
				sp[k].vy*=0.993
			 
			sp[k].detectWorldEdge()
			const rr =  0.3*(1.0+0.23*Math.sin(time*0.008))
			sp[k].width= rr
			sp[k].height=0.093/rr 
			sp[k].th+=dt*rnd(0.9,1.6)
			addSpriteToBuf(sp[k])
		}
		
		if(Mouse.btn>0){
			sp[0].vx = ( Mouse.x-sp[0].x )
			sp[0].vy = ( Mouse.y-sp[0].y )
			let v = Math.pow(sp[0].vx*sp[0].vx +sp[0].vy *sp[0].vy,0.5)
			if(v>0){
				v=0.05/v
				sp[0].vx *=v
				sp[0].vy *=v
			}
			Mouse.btn-=1
		}
			sp[0].th =  Math.PI+ Math.atan2(sp[0].vy,sp[0].vx)  
			let i=sp[0].b
			let j=sp[0].bb
			
			if(sp[0].vx>0){
				sp[0].b=Math.max(i,j)
				sp[0].bb=Math.min(i,j)
			}else
			{
				sp[0].bb=Math.max(i,j)
				sp[0].b=Math.min(i,j)
			}
				
			sp[0].x+= 0.6* sp[0].vx
			sp[0].y+= 0.6* sp[0].vy
			sp[0].detectWorldEdge()
			sp[0].vx*=0.993 
			sp[0].vy*=0.993 
			const th = time*0.009
			const tt = 1.0+0.2*Math.sin(th )
			sp[0].width = 0.25*tt
			sp[0].height = 0.3/tt
		
		 		
		addSpriteToBuf(sp[0])
		setBuffer(vbuf,new  Float32Array(vArr));
		
		 
		 setBuffer(cbuf, new  Float32Array(cArr));
		 setBuffer(tbuf, new  Float32Array(tArr))
		
		ctx.clearColor(0,0,0,1);
		ctx.clear(ctx.COLOR_BUFFER_BIT);
		
		
		ctx.drawArrays(ctx.TRIANGLES,0,vArr.length/2);
        
    
        if(animOn){
            if(showFPS)
				results.innerHTML ="fps:"+ Math.round(1.0/(dt+0.000001));
			else results.innerHTML =""
             requestAnimationFrame(drawScene);
        }else results.innerHTML="Click To Start";
	}
